import react, {Component} from 'react';
import Button from './Button';

class ExpandableList extends Component{

  componentDidMount(){
    console.log('value of this.props.listItems: ', 
      this.props.listItems);
    console.log('value of this.props.listItemExpl: ', 
      this.props.listItemExpl);
  }

  render(){
    return(
      <div
        style={{ 
          background: 'black', 
          color: 'white'
        }}
      >
        {
          this.props.listItems.map((element, key) => (
            <div key={key}>
              <Button item={element} itemExpl={this.props.listItemExpl[key]}/>
            </div>
          ))
        }
      </div>
    )
  }
}

export default ExpandableList;
